      attr_accessor :reason                # 0-* [ CodeableReference ]
      attr_accessor :bodySite              # 0-* [ CodeableConcept ]
      attr_accessor :bodyStructure         # 0-* [ Reference(BodyStructure) ]
      attr_accessor :outcome               # 0-* [ CodeableReference ]
      attr_accessor :report                # 0-* [ Reference(DiagnosticReport|DocumentReference|Composition) ]
      attr_accessor :complication          # 0-* [ CodeableReference ]
      attr_accessor :followUp              # 0-* [ CodeableReference ]
      attr_accessor :note                  # 0-* [ Annotation ]
      attr_accessor :focalDevice           # 0-* [ Procedure::FocalDevice ]
      attr_accessor :used                  # 0-* [ CodeableReference ]
      attr_accessor :supportingInfo        # 0-* [ Reference(Resource) ]

      def resourceType
        'Procedure'
      end
    end
  end
